import './App.css';
import Menu from "./Menu.js";
import Container from "./Container.js";
import Salud from "./Salud.js";
import { BrowserRouter, Route, Link } from 'react-router-dom';
import Anyadircita from './Anyadircita';


function App() {
  return (
    <BrowserRouter>
      <Menu />
      <Container />
      <Route path="/salud">
        <Salud />

      </Route>
      <Route path="/anyadircita">
          <Anyadircita />
        </Route>
    </BrowserRouter>





  );
}

export default App;
